window.bookSummaryJSON = "<p>Zwei Jahrhunderte lang verschwanden alle Darling-Mädchen an ihrem 18. Geburtstag. Manche für einen Tag, andere für eine Woche oder einen Monat. Aber sie kamen immer gebrochen zurück.</p> <p>Heute, am Nachmittag meines 18. Geburtstags, vergewissert sich meine Mutter, dass alle Fenster im Haus verriegelt und alle Türen abgeschlossen sind.</p> <p>Vergeblich.</p> <p>Sobald es dunkel wird, kommt er zu mir. Und diesmal lassen mich der Nimmerkönig und die Verlorenen Jungs nicht gehen.</p>"; 
